import CampaignABI from "@/contracts/CombinedContracts_Campaign.json";
import NFTBadgeABI from "@/contracts/CombinedContracts_NFTBadge.json";

export const campaignAddress = "0xCampaignContractAddress"; // Replace with actual Campaign address
export const nftBadgeAddress = "0xNFTBadgeContractAddress"; // Replace with actual NFTBadge address

export const Campaign = { abi: CampaignABI.abi, address: campaignAddress };
export const NFTBadge = { abi: NFTBadgeABI.abi, address: nftBadgeAddress };

export default {
  colors: {
    default: "#344675",
    primary: "#42b883",
    info: "#1d8cf8",
    danger: "#fd5d93",
    teal: "#00d6b4",
    primaryGradient: [
      "rgba(76, 211, 150, 0.1)",
      "rgba(53, 183, 125, 0)",
      "rgba(119,52,169,0)",
    ],
  },
};
